var yungtravla_check_delay = 20000

// Define the function that checks the shipping status
const yungtravla_check_status = () => {
	// We must send a GET request to the iframe's source as we cannot inspect the body of an iframe
	document.querySelector(".iframe-modal").click()

	yungtravla_req = new XMLHttpRequest()
	yungtravla_req.open("GET", document.querySelector(".oly-b iframe").src)
	yungtravla_req.send()
	yungtravla_req.onreadystatechange = () => {
		if (yungtravla_req.readyState == 4) {
			// Check if shipping status has updated
			yungtravla_stripped_response = yungtravla_req.responseText.replace(/\n/g, "").replace(/.*trackingEventContainer.*?>/g, "").replace(/<div\ style.*/g, "").toLowerCase()

			console.log(yungtravla_stripped_response.length)
			console.log(yungtravla_shipping_status.length)
			console.log(yungtravla_shipping_status == yungtravla_stripped_response)

			// Start alarm if shipping status has changed
			if (yungtravla_shipping_status != yungtravla_stripped_response) {
				for (var i = 1; i < 11; i++) {
					setTimeout(()=>{
						new Audio(yungtravla_alarm_bell).play()
					}, i*1000)
				}
			}

			// Remember shipping status
			yungtravla_shipping_status = yungtravla_stripped_response

			// Close iframe
			document.querySelector(".oly-c").click()
		}
	}
}

// Check that the right page is open, then run the script
if (location.pathname != "/myb/Summary") {
	alert("This script cannot be run on this page, please visit https://ebay.com/myb/Summary")
} else {
	yungtravla_check_status()

	yungtravla_loop = setInterval(()=>{
		yungtravla_check_status()
	}, yungtravla_check_delay)
}
